import './App.css';

class AddNumberRoot extends Component {
  render() {
    return(
      <div>
        <h1>Add Number Root</h1>
      </div>
    )
  }
}

function App() {
  return (
    <div className="App">
      Hello World
      <AddNumberRoot></AddNumberRoot>
    </div>
  );
}

export default App;
